class Signin extends React.Component{
            constructor(props){
            super(props);
            this.state={
                name: '',
                pwd: '',
                message: ''

            };
            }

            render(){
                return(
                    <div>                       
                    
                    <label><input onChange={this.setname} type="text" id="name" placeholder="Name" required/></label><br/>
                    <label><input onChange={this.setpwd} type="password" id="pwd" placeholder="Password" required/></label><br/>
                    <button onClick={this.goto} id="butup" name="buttonup">Sign Up</button>
                    <button  onClick={this.showMessage}id="butin" name="buttonin">Sign In</button>   
                    <div>{this.state.message}</div>                
                    
                    </div>
                );
            }
            setname = (event) => {
            this.setState({name: event.target.value});      
            console.log(this.state.name)       

            }

            setpwd = (event) => {
                this.setState({pwd: event.target.value});

            }

            showMessage = () =>{
                this.setState({
                    message: <h2>Hello {this.state.name}!</h2>                    
                });

            }

            goto = () =>{
                document.getElementById('SignIn').style.display = 'none'
                document.getElementById('SignUP').style.display = 'block'
                document.getElementById('name').value = ''
                document.getElementById('pwd').value = ''
            } 
        }

class Signin extends React.Component{
            constructor(props){
              super(props);
              this.state={
                  name: '',
                  password: '',
                  message: ''

              };
            }

            render(){
              const main={
                  width:"100rw",
                  minHeight:"100vh",
                  display:"grid",
                  placeItems:"center",
                  backgroundColor:"rgb(52, 130, 150)"

                }
              const inner={
                // backgroundColor:"white",
                borderRadius:"1rem solid balck",
              }
                return(
                  <div style={main}>
                    <div style={inner}> 
                                      
                    
                    <label><input onChange={this.updatename} type="text" id="name" placeholder="Name" required/></label><br/>
                    <label><input onChange={this.updatepassword} type="password" id="password" placeholder="Password" required/></label><br/>
                    <button onClick={this.update} id="signup" name="buttonup">Sign Up</button>
                    <button  style={{marginLeft:"88px"}} OnClick={this.Message} id="signin" name="buttonin">Sign In</button>   
                    <div>{this.state.message}</div>                
                    
                    </div>
                  </div>
                );
            }
            updatename = (event) => {
            this.setState({name: event.target.value});      
            // console.log(this.state.name)       

            }

            updatepassword = (event) => {
                this.setState({password: event.target.value});

            }

            Message = () =>{
                this.setState({
                    message: <h2>Hello {this.state.name}!</h2>                    
                });

            }

            update = () =>{
                document.getElementById('SignIn').style.display = 'none'
                document.getElementById('SignUP').style.display = 'block'
                document.getElementById('name').value = ''
                document.getElementById('password').value = ''

            }
        
        }
